    false,nt"url": null,nt"notes": "This Comprehensive Conservation Plan (CCP)
    was written to guide management on Block Island NWR for the next 15 years. This
    plan outlines the Refuge vision and purpose and describes how Block Island NWR will
    contribute to the overall mission of the Refuge System. The plan provides an introduction
    to the Refuge, an overview of the CCP process, a description of Refuge resources,
    the management direction, and strategies for implementation and monitoring. Key
    planning issues include: protecting endangered species, restoration of coastal sandplain
    communities, restoration of beach strand communities, control of invasive species,
    protection of biologically significant areas, and public use.",nt"license_title":
